function countingValleys(steps: number, path: string) {
  let valleys = 0;
  let level = 0;

  for (let i = 0; i < steps; i++) {
    if (path[i] === "U") {
      level++;
      if (level === 0) {
        valleys++;
      }
    } else {
      level--;
    }
  }

  return valleys;
}

console.log(countingValleys(12, "DDUUDDUDUUUD"));
console.log(countingValleys(8, "UDDDUDUU"));
console.log(
  countingValleys(
    1000000,
    ""
  )
);
